# -*- coding:utf-8 -*-

from unittest import TestCase


class Solution(object):
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        longest, s_len, i = 0, len(s), 0
        while i < s_len:
            t = self.getLongestStringFromStart(s[i:])
            if t[0] > longest:
                longest = t[0]
            i += t[1] + 1

            if s_len - i < longest:
                i += 99999999

        return longest

    def getLongestStringFromStart(self, s):
        """
        :param s: str
        :return:
        """

        longest, i, s_len = s[0], 1, len(s)
        while i < s_len and s[i] not in longest:
            longest += s[i]
            i += 1

        if i == s_len:
            return len(longest), s_len
        else:
            return len(longest), longest.index(s[i])


class SolutionTest(TestCase):
    def test(self):
        s = Solution()
        self.assertEqual(s.lengthOfLongestSubstring("anviaj"), 5)
        self.assertEqual(s.lengthOfLongestSubstring("dvdf"), 3)
        self.assertEqual(s.lengthOfLongestSubstring("abcabcbb"), 3)
        self.assertEqual(s.lengthOfLongestSubstring("bbbbb"), 1)
        self.assertEqual(s.lengthOfLongestSubstring("pwwkew"), 3)

